import React from 'react'
import './sidebar.css'

const sidebar = ({show}) => {
    const sideBarClass = ['sidebar']

    if(show){
        sideBarClass.push('show')
    }
  return (
    <div className={sideBarClass.join(" ")}>
      <ul className='sidebar_links'></ul>
    </div>
  )
}

export default sidebar
